import React from 'react';
import { Container, Smartmobile } from "./styles/Login";
import { StyleSheet, Text, View } from 'react-native';

const Login = () => {
  let [fontsLoaded] = useFonts({
    'Inter-Black': require('./fonts/MajorMonoDisplay-Regular.otf'),
  });

  if (!fontsLoaded) {
    return <AppLoading />;
  }

    return (
        <View>
        <Smartmobile> SmartMobile </Smartmobile>
      </View>
    );
  }
  
  export default Login;
